import React, {Component} from 'react';

class Routes extends Component {
    render() {
        return (
            <div>
                <Router>
                    <Suspense fallback={<Placeholder />}>
                        <Switch>
                            <Route path="/auth" component={Auth} />
                            <Route path="/" component={Index} />
                        </Switch>
                    </Suspense>
                </Router>
            </div>
        );
    }
}

export default Routes;
